import React from "react";


export default function WeatherForecastDay(props){
    return(
        <div>
             <div className="WeatherForecast-day">
                        {props.data.time}
                        </div>
                        <img src={props.data.condition.icon_url} alt={props.data[0].condition.description}/>

                        <div className="WeatherForecast-temperature"> 
                            <span className="WeatherForecast-temperature-max">{Math.round(props.data[0].temperature.maximum)}°</span>
                            <span className="WeatherForecast-temperature-min">{Math.round(props.data[0].temperature.minimum)}°°</span>

                        </div>
        </div>

    )


}
